import React, { useState } from "react";

const AddStock = () => {
  const [stockLabel, setStockLabel] = useState("Stock Label");
  const [stockBuyPrice, setStockBuyPrice] = useState("Buy Price");
  const [stockQuantity, setStockQuantity] = useState("Quantity");
  const [stockBuyDate, setStockBuyDate] = useState("Date");

  return (
    <>
      <h1 className="text-center mt-5">Stock List</h1>
      <form className="d-flex mt-5">
        <input
          className="form-control"
          type="text"
          value={stockLabel}
          onChange={(e) => setStockLabel(e.target.value)}
        ></input>
        <input
          className="form-control"
          type="text"
          value={stockBuyPrice}
        ></input>
        <input
          className="form-control"
          type="text"
          value={stockQuantity}
        ></input>
        <input
          className="form-control"
          type="text"
          value={stockBuyDate}
        ></input>
        <button className="btn btn-success">add</button>
      </form>
    </>
  );
};

export default AddStock;
